import React from 'react'
import { Card, CardHeader, CardBody, Box } from 'grommet';
import { Phone, User, Mail } from 'grommet-icons';

export default function ContactCard(props) {
    return (
        <Card width={'medium'} height={'small'} justify='center' align='center'>
            <CardHeader flex align='center'>
                <Box direction='row'>
                    <User color='brand' />{props.name}
                </Box>
            </CardHeader>
            <CardBody direction='row'>
                <Box align='center' justify='start'>
                    <Box direction={'row'}>
                        <Phone />{props.phone}
                    </Box>
                    <Box direction={'row'}>
                        <Mail />{props.email}
                    </Box>
                </Box>
            </CardBody>
        </Card>
    )
}
